const Header= ()=> {
return(
<>
<div className="container">
<div className="row">
<div className="col-md-6 col-12">


</div>
<div className="col-md-6 col-12">
<img src="images/header-right.png" alt="header=right"/>
  
</div>

</div>

</div>
</>
)}
export default Header;
